


angular.module('capitalconnect.controllers')

.controller('AccountCtrl', function($scope, $rootScope, $ionicModal, $timeout, $ionicSideMenuDelegate, $utils, $cordovaCamera, $api, $localStorage) {

	$scope.$on( "modal.shown", function( scopes, states ) {
		$scope.temp = $utils.clone($rootScope.ACCOUNT_DATA);
		$scope.isDirty = false;
	});

	$scope.$on( "modal.hidden", function( scopes, states ) {

	});

	$scope.onClose = function(){
		$rootScope.dlgAccount.remove();
		$rootScope.dlgAccount = null;
	};

      $scope.onPayment = function(){
            $ionicModal.fromTemplateUrl('templates/payment.html', {
                  scope: $rootScope,
                  backdropClickToClose: false
            }).then(function(modal) {
            	$scope.onClose();
                  $rootScope.dlgPayment = modal;
                  $rootScope.dlgPayment.show();
            });
      };

      $scope.onChange = function(){
      	$scope.isDirty = true;
      }

      $scope.onTakePhoto = function(ev){

      	// $scope.temp.photo = "data:image/jpeg;base64,";
      	
      	// return;

      	if (typeof navigator.camera === "undefined"){
			$utils.openAlert("Camera is not available in browsers");
			return;
      	}
      	
      	var popoverOptions = {
      		x: ev.clientX,
      		y: ev.clientY
      	};

		var options = {
			quality: 80,
			destinationType: Camera.DestinationType.DATA_URL,
			sourceType: Camera.PictureSourceType.CAMERA,
			encodingType: Camera.EncodingType.JPEG,
			targetWidth: 300,
			targetHeight: 300,
			cameraDirection: Camera.Direction.FRONT,
			popoverOptions: popoverOptions,
			saveToPhotoAlbum: false,
			correctOrientation: true
		};

		if (ionic.Platform.isIOS())
                 options.allowEdit = true;

		$cordovaCamera.getPicture(options)
		.then(function(dataUrl) {
                  $scope.onChange();
			$scope.temp.photo = "data:image/jpeg;base64," + dataUrl;
			// console.log(dataUrl);
		}, function(err) {
			// $utils.openAlert(err);
		});
      };

	$scope.onDone = function(){

		if (!$scope.isDirty){
			$scope.onClose();
			return;
		}

		if ($scope.temp.first_name.trim().length == 0){
			$utils.openAlert(CONFIG.reg_empty_firstname);
			return;
		}

		if ($scope.temp.last_name.trim().length == 0){
			$utils.openAlert(CONFIG.reg_empty_lastname);
			return;
		}

		if ((typeof $scope.temp.email !== "undefined") && ($scope.temp.email.trim().length == 0)){
			$utils.openAlert(CONFIG.reg_empty_email);
			return;
		}

		if ($utils.isValidEmail($scope.temp.email) == false){
			$utils.openAlert(CONFIG.reg_invalid_email);
			return;
		}

		if ($scope.temp.mobile.length < 7){
			$utils.openAlert(CONFIG.reg_invalid_phone);
			return;
		}

		$utils.showLoading(CONFIG.saving);

            var options = {
                  first_name: $scope.temp.first_name,
                  last_name: $scope.temp.last_name,
                  email: $scope.temp.email,
                  mobile: $scope.temp.mobile
            };

            if ($scope.temp.photo.indexOf("data:image/jpeg;base64,") == 0)
                  options.photo = $scope.temp.photo;

		$api.post('/account', options)

		.then(function(response, status, headers, config, statusText){

			if (response.data.photo)
				$scope.temp.photo = response.data.photo;

			$rootScope.ACCOUNT_DATA = $scope.temp;
			$localStorage.set("USER-ACCOUNT-DATA", $rootScope.ACCOUNT_DATA);
		
			$scope.onClose();

		}, function(response, status, headers, config, statusText){

			if ((response.data == null) && (response.status == 0)){
				$utils.openAlert(CONFIG.offline_alert);
				return;
			}

			if (response.data.errors){
				$utils.openAlert(response.data.errors[0]);
				return;
			}
		})

		['finally'](function(){
			$utils.hideLoading();
		});
	};
});
